script: |
  super -f text -I q9344.spq | sort > q9344.out

inputs:
  - name: q9344.spq
    data: |
      SELECT + col0 * + 40 * - + col0, + col2 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE - col2 - + col2 IN ( + + col1 * - + ( - - 53 ), + col1 / col0 * col2 * + - col2, + 25, col1 );
  - name: tab0

outputs:
  - name: q9344.out
    data: |
